            <br />

            <Table striped bordered hover>
                <thead style={{ textAlign: 'center' }}>
                    <tr>
                        <th style={{ padding: '15px', backgroundColor: "#e6f3ff" , }}>PAN Number</th>
                        <th style={{ padding: '15px', backgroundColor: "#e6f3ff" }}>User</th>
                        <th style={{ padding: '15px', backgroundColor: "#e6f3ff" }}>Invested Amount</th>
                        <th style={{ padding: '15px', backgroundColor: "#e6f3ff" }}>Current Amount</th>

                    </tr>
                </thead>
                <tbody>
                    <tr style={{ padding: '15px' }}>

                        <td style={{ padding: '15px' , fontWeight:'bold' }}>  <Link to="/authentication/error/user">ABKPS0801L</Link></td>

                        <td style={{ padding: '15px', fontWeight:'bold' }}>ANURAAG SABOO</td>

                        <td>1,70,39,811</td>

                        <td>1,78,98,783</td>

                    </tr>

                    <tr style={{ padding: '15px' }}>

                        <td> Total</td>

                        <td>-</td>

                        <td>	2,61,78,383</td>

                        <td>	3,01,29,221</td>

                    </tr>
                </tbody>
            </Table>

            <Footer />
        </DashboardLayout>
    );
}

export default External;
